import React from 'react';

function MemberDashboard() {
  return (
    <div className="dashboard">
      <h1>Member Dashboard</h1>
      <p>Order History</p>
      <p>Bookmarks</p>
      <p>Profile Settings</p>
    </div>
  );
}

export default MemberDashboard;
